INSERT INTO `acd_layananjenis` (`id`, `nama_layanan`, `prasyarat_layanan`) VALUES
('0fa10c069e0b41678aab075811ee67d2', 'SURAT REKOMENDASI BEASISWA', '1. KHS terbaru\r\n2. Flyer/screenshot informasi beasiswa\r\n3. Bukti prestasi'),
('af52a21645714cb9803ac2876bd1f01b', 'URAT KETERANGAN TIDAK MENERIMA BEASISWA DARI PIHAK LAIN', '1. UPLOAD BUKTI PEMBAYARAN SPP/UKT\r\n2. KHS SEMESTER TERAKHIR'),
('b3f5014b4e4f4df49a64ba0962e8eeb1', 'SURAT KETERANGAN PINDAH', 'Sebelum mengisi form Surat Keterangan Pindah, Mahasiswa harus membuat Surat Permohonan Pindah. Surat Pemohonan Pindah dapat diperoleh melalui admin prodi.\r\n\r\nSetelah mendapat persetujuan dari Ketua Program Studi, Mahasiswa mengisi form Surat Permohonan Pindahnya yang selanjutnya akan diproseskan Surat Keterangan Pindah. Untuk Surat Keterangan Pindah.\r\n\r\n1. Surat Permohonan Pindah\r\n2. Bukti Pembayaran Semester Genap 2024/2025'),
('bdc8478b20bd4fbbae2e2a98d3af12ca', 'SURAT KETERANGAN AKTIF KULIAH', '1. Bukti Pembayaran Genap 2024/2025\r\n2. Kartu Rencana Studi Genap 2024/2025 \r\n3. Kartu Hasil Studi Semester Ganjil 2024/2025\r\n4. Mahasiswa yang ikut Semester Antara, silakan masukkan juga KHS SA terakhir'),
('c08565db283e4f5099c6d694230f4ed1', 'SURAT KETERANGAN CUTI SEMESTER', 'HARAP DICERMATI INFORMASI PENGURUSAN CUTI BERIKUT:\r\nSebelum mengurus Surat Keterangan Cuti, Mahasiswa harus membuat Surat Permohonan Cuti. Surat Pemohonan Cuti dapat diperoleh melalui grup telegram (\r\n\r\nhttps://t.me/+fe0nRGLTvl0xM2M1 )\r\n\r\nSetelah mendapat persetujuan dari Penasehat Akademik dan Ketua Program Studi, Mahasiswa membawa Surat Permohonan Cutinya ke bagian Tata Usaha atas nama Kak Yaya yang selanjutnya akan diproseskan Surat Keterangan Cuti. \r\n\r\nJika ada pertanyaan silahkan disampaikan melalui grup telegram surat keterangan cuti \r\n\r\n1. Bukti Pembayaran Semester Terakhir dan Surat Permohonan Cuti (1 File)'),
('cf5860ad2c234dc6966bf768d51006e3', 'SURAT IZIN PENELITIAN SKRIPSI DAN TUGAS AKHIR', '1. Lembar Pengesahan\r\n2. Surat Pengantar dari Jurusan\r\n3. Mahasiswa dapat Mengakses Link  https://izin-penelitian.sulselprov.go.id/ .untuk pengurusan izin penelitian ke DPMPTSP.'),
('d16d209510d642238ae6a6768b910e9b', 'SURAT KELAKUAN BAIK', 'SURAT TERSEBUT DIBUTUHKAN UNTUK KEPERLUAN APA?\r\n*');
